    //手引导
    showHand() {
        this.hand = this.add.image(this.arr_key[this.arr_key.length - 3].x + 120, this.arr_key[this.arr_key.length - 3].y - 10, 'hand').setOrigin(0.22, 0.1)
        this.hand.scaleX = 0.5
        this.hand.scaleY = 0.5
        this.hand.setDepth(10)
        this.tweens.add({
            targets: [this.hand],
            x: this.arr_value[this.arr_value.length - 2].x - 55,
            y: this.arr_value[this.arr_value.length - 2].y,
            duration: 600,
            callbackScope: this,
            onComplete: () => {
                setTimeout(() => {
                    this.tweens.add({
                        targets: [this.hand],
                        x: this.arr_key[this.arr_key.length - 3].x + 120,
                        y: this.arr_key[this.arr_key.length - 3].y,
                        duration: 1
                    })
                }, 300);
            }
        })
        this.hand_interval = setInterval(() => {
            this.tweens.add({
                targets: [this.hand],
                x: this.arr_value[this.arr_value.length - 2].x - 55,
                y: this.arr_value[this.arr_value.length - 2].y,
                duration: 600,
                callbackScope: this,
                onComplete: () => {
                    setTimeout(() => {
                        this.tweens.add({
                            targets: [this.hand],
                            x: this.arr_key[this.arr_key.length - 3].x + 120,
                            y: this.arr_key[this.arr_key.length - 3].y - 10,
                            duration: 1
                        })
                    }, 300);
                }
            })
        }, 1800);
    }

